    public String[] GetCollege(String x) {
        Cursor c=ourDatabase.rawQuery("SELECT NAME FROM "+DATABASE_TABLE+" WHERE "+KEY_COLLEGE+" LIKE "+"\'%"+x+"%\'", null);


        int dayExercise = c.getColumnIndex(KEY_NAME);

        String[] list = new String[c.getCount()];
        int j = 0;
        for (c.moveToFirst(); !c.isAfterLast(); c.moveToNext()){
            list[j] = c.getString(dayExercise);
            j++;
        }

        return list;
    }
